import React from 'react';
import './App.css';
import {Box} from '@mui/material'
import Navbar from './component/Navbar';
function App() {
  return (
    <Box width="400px"  sx ={{width:{xl:'1488px'}}} m='auto'>
        <Navbar />
        <Routes>
            <Route path='/' element={<Home />} />
        </Routes>
        <Routes>
            <Route path='/exercise/:id' element={ <ExerciseDetail /> } />
        </Routes>
        <Footer />
    </Box>
  );
}

export default App;
